"""#Versiunea cu PYGAD"""

import pygad
import numpy

"""
Având în vedere următoarea funcție:
    y = f (w1: w6) = w1x1 + w2x2 + w3x3 + w4x4 + w5x5 + 6wx6
    unde (x1, x2, x3, x4, x5, x6) = (4, -2,3.5,5, -11, -4.7) și y = 44
Care sunt cele mai bune valori pentru cele 6 greutăți (w1 la w6)? Vom folosi algoritmul genetic pentru a optimiza această funcție.
"""

function_inputs = [4,-2,3.5,5,-11,-4.7] # Intrări funcționale.

desired_output = 44 # Ieșire funcție.

def fitness_func(solution, solution_idx):
    # Calculul valorii de fitness a fiecărei soluții din populația actuală.
    # Funcția de fitness calculează suma produselor dintre fiecare intrare și greutatea sa corespunzătoare.
    output = numpy.sum(solution*function_inputs)
    fitness = 1.0 / numpy.abs(output - desired_output)
    return fitness

fitness_function = fitness_func

num_generations = 100 # Numărul de generații.
num_parents_mating = 7 # Numărul de soluții care trebuie selectate ca părinți în grupul de împerechere.

# Pentru a pregăti populația inițială, există 2 moduri:
# 1) Pregătiți-l singur și treceți-l la parametrul initial_population. Acest mod este util atunci când utilizatorul dorește să înceapă algoritmul genetic cu o populație inițială personalizată.
# 2) Atribuiți valori întregi valide parametrilor sol_per_pop și num_genes. Dacă parametrul initial_population există, atunci parametrii sol_per_pop și num_genes sunt inutili.
sol_per_pop = 50 # Numărul de soluții din populație.
num_genes = len(function_inputs)

init_range_low = -2
init_range_high = 5

parent_selection_type = "sss" # Tipul de selecție părinte.
keep_parents = 7 # Numărul de părinți de menținut în următoarea populație. -1 înseamnă să păstrezi toți părinții și 0 înseamnă să nu păstrezi nimic.

crossover_type = "single_point" # Tipul operatorului crossover.

# Parametrii operației de mutație.
mutation_type = "random" # Tipul operatorului de mutație.
mutation_percent_genes = 10 # Procentul de gene care trebuie mutate. Acest parametru nu are nicio acțiune dacă parametrul mutation_num_genes există sau când mutation_type este None.

last_fitness = 0
def callback_generation(ga_instance):
    global last_fitness
    print("Generation = {generation}".format(generation=ga_instance.generations_completed))
    print("Fitness    = {fitness}".format(fitness=ga_instance.best_solution()[1]))
    print("Change     = {change}".format(change=ga_instance.best_solution()[1] - last_fitness))
    last_fitness = ga_instance.best_solution()[1]

# Crearea unei instanțe a clasei AG în interiorul modulului ga. Unii parametri sunt inițializați în cadrul constructorului.
ga_instance = pygad.GA(num_generations=num_generations,
                       num_parents_mating=num_parents_mating,
                       fitness_func=fitness_function,
                       sol_per_pop=sol_per_pop,
                       num_genes=num_genes,
                       init_range_low=init_range_low,
                       init_range_high=init_range_high,
                       parent_selection_type=parent_selection_type,
                       keep_parents=keep_parents,
                       crossover_type=crossover_type,
                       mutation_type=mutation_type,
                       mutation_percent_genes=mutation_percent_genes,
                       on_generation=callback_generation)

# Rularea AG pentru a optimiza parametrii funcției.
ga_instance.run()

# După finalizarea generațiilor, sunt prezentate câteva comploturi care rezumă modul în care valorile rezultatelor / fitens evoluează de-a lungul generațiilor.
ga_instance.plot_result()

# Revenind la detaliile celei mai bune soluții.
solution, solution_fitness, solution_idx = ga_instance.best_solution()
print("Parameters of the best solution : {solution}".format(solution=solution))
print("Fitness value of the best solution = {solution_fitness}".format(solution_fitness=solution_fitness))
print("Index of the best solution : {solution_idx}".format(solution_idx=solution_idx))

prediction = numpy.sum(numpy.array(function_inputs)*solution)
print("Predicted output based on the best solution : {prediction}".format(prediction=prediction))

if ga_instance.best_solution_generation != -1:
    print("Best fitness value reached after {best_solution_generation} generations.".format(best_solution_generation=ga_instance.best_solution_generation))

# Salvarea instanței AG.
filename = 'genetic' # Numele fișierului în care este salvată instanța. Numele este fără extensie.
ga_instance.save(filename=filename)

# Se încarcă instanța AG salvată.
loaded_ga_instance = pygad.load(filename=filename)
loaded_ga_instance.plot_result()

